import { NavLink } from "react-router-dom";


export default function NavBar() {
  return (
    <nav className="navbar bg-ebfbee">
      <div className="container text-center d-flex flex-column align-items-center justify-content-center vh-10 mt-3">
        <div>
          <NavLink to="/login" className="navbar-title fs-10 title-style" style={{ textDecoration: 'none', color: 'black', fontSize: '7vmin' }}>
          Login
          </NavLink>
          <br/>
          <div className="d-flex links">
            <NavLink>
            </NavLink>

          </div>
        </div>
      </div>
    </nav>
  );
}
